<!DOCTYPE html>
<html>
<head>
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js">></script>
</head>
<script>
window.onbeforeunload = function() {
    return "Leaving site...";
};

$(document).ready(function(){
  var selectedCountry = "none selected";
  
  $("path").click(function(){
	var myName = "none";
	if (typeof $(this).attr("name") !== typeof undefined) {
      myName = $(this).attr("name");
	}
    var myClass = $(this).attr("id");
	if($('[id="' + myClass + '"]').attr("selected") != "true"){
	  $('[selected=true]').removeAttr("selected");
	  $('[id="' + myClass + '"]').attr("selected","true");
      $("#displayText").text(myClass + " --- " + myName);
	  selectedCountry = myClass;
	}
	else{ //selecting already green country
	  $('[selected=true]').removeAttr("selected");
	  $("#displayText").text(myClass);
	  selectedCountry = "none selected";
	}
  });
  
  /*$('#countryname').keypress(function (e) {
    if (e.which == 13) { //enter
      if(selectedCountry == "none selected"){
	    alert("No country selected");
	  }
	  else
	  {
	    if(selectedCountry.toLowerCase() == $("#countryname").val().toLowerCase()){
		  $('[id="' + selectedCountry + '"]').attr("fill","green");
		  selectedCountry = "none selected";
		}
		else{
		  alert("Wrong!");
		}
	  }
	  
	  $("#countryname").val(''); //clear input field
    }*/
	
	$('#countryname').keypress(function (e) {
	  if (e.which == 13) { //enter
        if(selectedCountry == "none selected"){
	      alert("No country selected");
	    }
	    else
	    {
		  $('[id="' + selectedCountry + '"]').attr("name", $("#countryname").val());
		  $('[id="btnSaveSvg"]').removeAttr("disabled"); //svg updated so we can save it
	    }
	  
	    $('[selected=true]').removeAttr("selected");
	    selectedCountry = "none selected";
	    $("#countryname").val(''); //clear input field
		
		$('[id="progressText"]').text($("path[name]").length + "/" + $("path").length + " (" + ((100 * $("path[name]").length) / $("path").length).toFixed(2) + "%)"); //update progress count
	  }
    });
	
	$('[id="progressText"]').text($("path[name]").length + "/" + $("path").length + " (" + ((100 * $("path[name]").length) / $("path").length).toFixed(2) + "%)");
});

function saveSvg() {
  $('[id="btnSaveSvg"]').attr("disabled", ""); //svg saved so we can grey out this button until next update
  const svg = document.querySelector('svg');
  const base64doc = btoa(unescape(encodeURIComponent(svg.outerHTML)));
  const a = document.createElement('a');
  const e = new MouseEvent('click');
  a.download = 'download.svg';
  a.href = 'data:image/svg+xml;base64,' + base64doc;
  a.dispatchEvent(e);
};

function changeZoomLevel() {
  var slider = document.getElementById('zoomSlider');
  if(slider.value == 1){
    document.getElementById('zoomLevelText').innerHTML = "125%";
	document.getElementById('map').style['zoom'] = "125%";
  }
  else if(slider.value == 2){
    document.getElementById('zoomLevelText').innerHTML = "150%";
	document.getElementById('map').style['zoom'] = "150%";
  }
  else if(slider.value == 3){
    document.getElementById('zoomLevelText').innerHTML = "200%";
	document.getElementById('map').style['zoom'] = "200%";
  }
  else if(slider.value == 4){
    document.getElementById('zoomLevelText').innerHTML = "300%";
	document.getElementById('map').style['zoom'] = "300%";
  }
  else if(slider.value == 5){
    document.getElementById('zoomLevelText').innerHTML = "500%";
	document.getElementById('map').style['zoom'] = "500%";
  }
  else{
    document.getElementById('zoomLevelText').innerHTML = "100%";
	document.getElementById('map').style['zoom'] = "100%";
  }
};
</script>

<style>
  path[name] {
    fill: green;
  }
  path[selected=true] {
    fill: red;
  }
  path[selected=true][name] {
    fill: yellow
  }
  label {
    display: inline-block;
    margin: 10px;
  }
  .slider {
    width: 70%;
  }
</style>

<body>
<div id="header" style="position: fixed;">
  <label id="displayText">None selected</label><button id="btnSaveSvg" onclick="saveSvg()" disabled>Save updated SVG</button><br>
  <div class="slideContainer">
    <input type="range" min="0" max="5" value="0" class="slider" id="zoomSlider" oninput="changeZoomLevel()">
	<label id="zoomLevelText">100%</label>
  </div><br>
  <label id="progressText">x/x</label>
  <label for="countryname">Selected country:</label>
  <input type="text" id="countryname" name="countryname">
<hr>
</div>
